import React from 'react'



const Profile=()=>{
    return (
        <div>
            <div style={{
                display:"felx",
                justifyContent:"space-around",
                margin:"18px 0px"
            }}>
                <div
 
                  style={{
                      marginTop:"5px",
                      
                    width: "150px",
                    height: "150px",
                    borderRadius: "80px"
                  }}
                  src="https://images.unsplash.com/photo-1503249023995-51b0f3778ccf?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=900&q=60" 
                  />

                  
                
                <div>
                    <h4>Himanshu Tewari</h4>
                   

                </div>
            </div>
            </div>
    )
}


export default Profile
